DROP DATABASE plato;

CREATE DATABASE plato;

USE plato

CREATE TABLE reviews (
  ID int NOT NULL AUTO_INCREMENT,
  ProductId int,
  Title varchar(200),
  Username varchar(20) NOT NULL,
  Review varchar(1000) NOT NULL,
  Date varchar(15), 
  Stars int NOT NULL,
  Upvotes int NOT NULL,
  Downvotes int NOT NULL,
  PRIMARY KEY (ID)
  
);



